import './App.css';
import './index.scss';
import 'bootstrap/dist/css/bootstrap.min.css';
import LoginForm from './components/LoginForm';
import ServersList from './components/ServersList';
import LoginPage from './components/LoginPage';

function App() {
  return (
    <div className="App">
      <LoginPage></LoginPage>
      <ServersList></ServersList>
    </div>
  );
}

export default App;
